import { Box, useColorModeValue, Text, card, Divider } from "@chakra-ui/react";

export default function Header() {
  return (
    <>
      <Box bg={useColorModeValue("#1D5B79")} px={4}>
        <Text p={10} textAlign={"center"} fontSize={"3xl"} fontWeight={'500'} color={"white "}>
          T-MACHINE SOFTWARE SOLUTION PVT.LTD
        </Text>
      </Box>
    </>
  );
}
